    <style>
      body {
        margin-bottom: 0;
        background-color: #1e1e1e;
        position: relative;
        font-family: "Poppins", sans-serif;
        color: #f2f2f2;
      }

      :root {
        --loader-color: #ececec;
        --preview: #1e1e1e;
      }

      .white {
        --loader-color: #2b2b2b;
        --preview: #ffffff;
      }

      #container {
        width: 100%;
        height: calc(100% - 43.5px - 69.1px);
      }

      #preview {
        width: 100%;
        height: calc(100% - 43.5px - 69.1px);
        border: none;
        background-color: var(--preview);
        overflow: auto;
        color: #353535;
      }

      #preview .img {
        position: absolute;
        bottom: 8px;
        right: 0;
      }

      #downloadBtn {
        font-family: "Poppins", sans-serif;
        font-size: 13px !important;
        padding: 10px 15px !important;
        width: 100%;
        height: 40px;
      }

      .bottom-btn {
        position: absolute;
        bottom: 0;
        background-color: #2b2b2b;
        padding: 14px 24px;
        width: 100%;
      }

      .avatar {
        position: absolute;
        z-index: 1;
        right: 0;
        top: -50px;
      }

      .text {
        position: absolute;
        left: 24px;
        bottom: 100px;
      }

      .text h1 {
        font-weight: 800;
        color: #ababab;
        font-family: "Poppins", sans-serif;
        line-height: 45px;
        font-size: 32px;
      }

      .w3-button {
        padding: 12px 24px !important;
        font-size: 13px;
        font-family: "Poppins", sans-serif;
        font-weight: 500;
        color: #878e98;
        transition: 0.3s;
      }

      .w3-button:hover:not(.active) {
        background-color: #4d4d4d !important;
        color: #ffffff !important;
      }

      .upi-btn-info {
        position: absolute;
        right: 0;
      }

      .upi-btn-info:hover svg path {
        fill: #ffffff !important;
      }

      .w3-bar {
        background-color: #2b2b2b;
        display: flex;
        align-items: center;
        position: relative;
      }

      .active {
        background-color: #353535 !important;
        color: #ffffff;
      }

      .active:hover {
        background-color: #353535 !important;
        color: #ffffff !important;
      }

      .show {
        display: block;
      }

      .alert {
        margin-top: -78px !important;
        margin-left: 24px;
        margin-right: 24px;
        margin-bottom: unset;
      }

      .loader {
        color: var(--loader-color);
        font-family: Consolas, Menlo, Monaco, monospace;
        font-weight: bold;
        font-size: 78px;
        opacity: 0.8;
        position: absolute;
        left: 50%;
        top: 40%;
        transform: translate(-50%, -50%);
      }
      .loader:before {
        content: "{";
        display: inline-block;
        animation: pulse 0.4s alternate infinite ease-in-out;
      }
      .loader:after {
        content: "}";
        display: inline-block;
        animation: pulse 0.4s 0.3s alternate infinite ease-in-out;
      }

      @keyframes pulse {
        to {
          transform: scale(0.8);
          opacity: 0.5;
        }
      }

      .modal-header {
        border: none !important;
        color: #353535 !important;
        padding: 5px 1rem !important;
      }

      .modal-footer {
        border: none !important;
        justify-content: center;
        font-size: 12px !important;
        color: #4d4d4d !important;
      }

      .modal-title {
        margin-top: 0;
      }

      .modal-body {
        color: #353535 !important;
      }

      .linkedin-button {
        display: flex;
        justify-content: center;
        align-items: center;
        font-family: Arial, sans-serif;
        font-size: 14px;
        font-weight: bold;
        color: #fff;
        background-color: #0077b5;
        border: 1px solid #0077b5;
        border-radius: 3px;
        padding: 10px 20px;
        text-decoration: none;
        transition: background-color 0.3s, border-color 0.3s;
      }
      .linkedin-button:hover {
        background-color: #005983;
        border-color: #005983;
      }
      .linkedin svg path {
        fill: #fff !important;
      }

      .loader-button {
        width: 12px;
        height: 12px;
        border-radius: 50%;
        display: block;
        margin: 0px auto;
        position: relative;
        color: #fff;
        box-sizing: border-box;
        transform: scale(0.5);
        animation: animloader 1s linear infinite alternate;
      }

      @keyframes animloader {
        0% {
          box-shadow: -38px -6px, -14px 6px, 14px -6px;
        }
        33% {
          box-shadow: -38px 6px, -14px -6px, 14px 6px;
        }
        66% {
          box-shadow: -38px -6px, -14px 6px, 14px -6px;
        }
        100% {
          box-shadow: -38px 6px, -14px -6px, 14px 6px;
        }
      }
    </style>
  </head>

        var i, x, tablinks;
        x = document.getElementsByClassName("tab");
        for (i = 0; i < x.length; i++) {
          x[i].style.display = "none";
        }
        tablinks = document.getElementsByClassName("tablink");
        for (i = 0; i < tablinks.length; i++) {
          tablinks[i].className = tablinks[i].className.replace(" active", "");
        }
        document.getElementById(tabName).style.display = "block";
        evt.currentTarget.className += " active";
      }

      require.config({
        paths: {
          vs: "https://cdnjs.cloudflare.com/ajax/libs/monaco-editor/0.34.0/min/vs",
        },
      });
      require(["vs/editor/editor.main"], function () {
        window.editor = monaco.editor.create(
          document.getElementById("container"),
          {
            value: "",
            language: "html",
            theme: "vs-light",
            readOnly: true,
            tabSize: 2,
            insertSpaces: true,
            formatOnPaste: true,
            formatOnType: true,
            autoClosingBrackets: "always",
            automaticLayout: true,
            innerWidth: 200,
          }
        );
      });

      const downloadBtn = document.querySelector("#downloadBtn");
      let isDownloading = false;
      downloadBtn.setAttribute("disabled", "true");
      window.onmessage = async (event) => {
        try {
          const { type, svg, name, isMultipleSelect, zip } =
            event.data.pluginMessage;
          if (type === "display-svg") {
            const preview = document.getElementById("preview");
            downloadBtn.removeAttribute("disabled");

            isMultipleSelect ? downloadBtn.innerHTML = 'Download ZIP' : downloadBtn.innerHTML = 'Download SVG'

            window.editor.setValue(svg);
            preview.innerHTML = svg;
            preview.classList.add("white");

            // Download button functionality
            downloadBtn.onclick = () => {
              isDownloading = true;
              downloadBtn.disabled = true;
              downloadBtn.innerHTML = '<span class="loader-button"></span>';

              var blob = isMultipleSelect ? new Blob([zip], { type: "application/zip" }) :new Blob([svg], { type: "image/svg+xml" });
              var url = URL.createObjectURL(blob);
              var a = document.createElement("a");
              a.href = url;
              a.download = isMultipleSelect ? 'UpiLine_SVG_Files.zip' : `${name}.svg`;
              document.body.appendChild(a);
              a.click();
              document.body.removeChild(a);
              URL.revokeObjectURL(url);

              window.addEventListener(
                "focus",
                () => {
                  if (isDownloading) {
                    downloadBtn.textContent = isMultipleSelect ? "Download ZIP": "Download SVG";
                    downloadBtn.disabled = false;
                    isDownloading = false;
                  }
                },
                { once: true }
              );
            };
          }

          if (type === "loading") {
            const preview = document.querySelector("#preview");
            preview.innerHTML = '<span class="loader"></span>';
          }
        } catch (error) {
          console.log("Error handling message:", error);
        }
      };
    </script>
  </body>
</html>
